jQuery.fn.schDate = function(){
	var $obj = $(this);
	var $chk = $obj.find("input[type=radio]");
	$chk.click(function(){				
		$('input:not(:checked)').parent(".chkbox2").removeClass("on");
		$('input:checked').parent(".chkbox2").addClass("on");					
	});
};

